import{_ as a,c as t,o,aM as i}from"./chunks/framework.DAyGILei.js";const n="/assets/hunt-cloud-writing-tools.BNIBYAvY.png",g=JSON.parse('{"title":"Labting","description":"This page list information and questions about our Labting.","frontmatter":{"title":"Labting","category":"Tingweek","permalink":"/do-science/community/labting/","outline":1,"description":"This page list information and questions about our Labting."},"headers":[],"relativePath":"do-science/community/labting.md","filePath":"do-science/community/labting.md"}'),r={name:"do-science/community/labting.md"};function s(l,e,c,d,u,h){return o(),t("div",null,[...e[0]||(e[0]=[i('<h1 id="labting" tabindex="-1">Labting <a class="header-anchor" href="#labting" aria-label="Permalink to &quot;Labting&quot;">​</a></h1><p><strong>You will be invited to join our Labting three times per year. This is the place where we meet to discuss and develop your user experience in HUNT Cloud.</strong></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Read more about the <a href="/govern-science/tingweek/">Tingweek</a> in our govern-science section.</p></div><p><img src="'+n+'" alt="&quot;Old feather pen and letter seal.&quot;"></p><h2 id="you-should-participate" tabindex="-1">You should participate! <a class="header-anchor" href="#you-should-participate" aria-label="Permalink to &quot;You should participate!&quot;">​</a></h2><p><strong>Science never sleeps. And no service will ever be perfect.</strong></p><p>Join the Labting to voice your hard earned expertise, and to help us to evolve the user experience in HUNT Cloud for both yourself and others.</p><p>We will cover a set of topics for each meeting that are related to your user experience, such as the HUNT Workbench, lab environments, service desk, web documentation, community, communication and similar.</p><p><strong>Most products and services that you use in HUNT Cloud have come together as a collaborative effort between members of the cloud community and our HUNT Cloud team, and may have been discussed and developed with input from our Labting.</strong></p><h3 id="all-lab-users-will-be-invited" tabindex="-1">All lab users will be invited <a class="header-anchor" href="#all-lab-users-will-be-invited" aria-label="Permalink to &quot;All lab users will be invited&quot;">​</a></h3><p>All active lab users, lab leaders and lab coordinators will get an invitation on the organizational email that you specified in your user agreement.</p><p>Participation in Labting is voluntary. Contact us in the <a href="/do-science/service-desk/#general-service-request">service desk</a> if you want to reserve yourself from receiving future Ting invitations.</p><h3 id="labting-take-place-on-zoom" tabindex="-1">Labting take place on Zoom <a class="header-anchor" href="#labting-take-place-on-zoom" aria-label="Permalink to &quot;Labting take place on Zoom&quot;">​</a></h3><p>Labtings takes place on NTNU&#39;s Zoom subscription. Links are shared in the email invitation and will be shared on the <code>cloud-community</code> channel in Slack on the same days as the meeting.</p><h3 id="come-and-go-as-you-like" tabindex="-1">Come and go as you like <a class="header-anchor" href="#come-and-go-as-you-like" aria-label="Permalink to &quot;Come and go as you like&quot;">​</a></h3><p><strong>Our Labting is held on Tuesday between 2-4 pm CET during the Tingweek.</strong></p><p>The first hour is reserved for a structured agenda, while the second hour is reserved for unstructured dialogue.</p><p>You may choose to join and leave when you want. Some prefer to stay for fixed agenda, while others like to stay for the dialogue in the second hour.</p><h3 id="see-when-the-next-labting-is-held" tabindex="-1">See when the next Labting is held <a class="header-anchor" href="#see-when-the-next-labting-is-held" aria-label="Permalink to &quot;See when the next Labting is held&quot;">​</a></h3><p><a href="/govern-science/tingweek/dates">Dates for upcoming Tingweeks</a></p>',20)])])}const m=a(r,[["render",s]]);export{g as __pageData,m as default};
